import * as React from "react";
import { Layout, Menu, Breadcrumb } from "antd";
import "./default.less";

const { Header, Content, Footer } = Layout;

const DefaultLayout: React.FunctionComponent = ({ children }) => (
  <div>
    <Layout className="layout">
      <Header id="header">
        <div className="logo" />
        <Menu id="menu" theme="dark" mode="horizontal" defaultSelectedKeys={["2"]}>
          <Menu.Item key="1">ほげ</Menu.Item>
          <Menu.Item key="2">ふが</Menu.Item>
          <Menu.Item key="3">なんとかかんとか</Menu.Item>
        </Menu>
      </Header>
      <Content id="content">
        <div style={{ background: "#fff", padding: 24, minHeight: 280 }}>
          {children}
        </div>
      </Content>
      <Footer id="footer">Ant Design ©2018 Created by Ant UED</Footer>
    </Layout>
  </div>
);

export default DefaultLayout;
